const reconextLogoBase64 =
  "data:image/jpeg;base64,";
const ingenicoLogoBase64 =
  "data:image/jpeg;base64,";
const libertyLogoBase64 =
  "data:image/jpeg;base64,";
const dellLogoBase64 =
  "data:image/jpeg;base64,";
const skyLogoBase64 =
  "data:image/jpeg;base64,";
const boseLogoBase64 =
  "data:image/jpeg;base64,";

interface ITemplate {
  id: number;
  name: string;
  images: string[]; // Array of Base64 image strings
}

class Template implements ITemplate {
  id: number;
  name: string;
  images: string[];

  constructor(object: ITemplate) {
    this.id = object.id;
    this.name = object.name;
    this.images = object.images;
  }
}

class CustomTemplate implements ITemplate {
  id: number = 6;
  name: string = "Custom";
  images: string[] = [reconextLogoBase64];

  constructor(images: string[]) {
    if (images.length > 0) this.images = images;
  }
}

const imageTemplateOptions: Template[] = [
  {
    id: 1,
    name: "Ingenico",
    images: [ingenicoLogoBase64, reconextLogoBase64],
  },
  {
    id: 2,
    name: "SKY",
    images: [skyLogoBase64, reconextLogoBase64],
  },
  {
    id: 3,
    name: "Liberty CPE",
    images: [libertyLogoBase64, reconextLogoBase64],
  },
  {
    id: 4,
    name: "DELL",
    images: [dellLogoBase64, reconextLogoBase64],
  },
  {
    id: 5,
    name: "Bose",
    images: [boseLogoBase64, reconextLogoBase64],
  },
  {
    id: 6,
    name: "Custom",
    images: [reconextLogoBase64],
  },
];

function findOrCreateCustomTemplate(images: string[]): Template {
  // Helper function to compare arrays
  const arraysAreEqual = (arr1: string[], arr2: string[]): boolean => {
    if (arr1.length !== arr2.length) return false;
    return arr1.every((image, index) => image === arr2[index]);
  };

  // Search for a matching template
  const matchingTemplate = imageTemplateOptions.find((template) =>
    arraysAreEqual(template.images, images)
  );

  // If a match is found, return it
  if (matchingTemplate) {
    return matchingTemplate;
  }

  return new CustomTemplate(images);
}

export { imageTemplateOptions, findOrCreateCustomTemplate, type ITemplate, Template };
